import React from "react";
import { Link, useLocation } from "react-router-dom";
import "../App.css";

function NavBar() {

  const location = useLocation();

  return (

    <nav className="navbar fixed-top navbar-light navbar-custom">

        <ul className="nav justify-content-end fixed">
            <li className="nav-item">
                <Link to="/about" className={location.pathname==="/" ? "nav-link active" : "nav-link"} 

                style={{fontFamily:'Verdana'}}>

                About
                </Link>
            </li>

            <li className="nav-item">
                <Link to="about#portfolio" className={location.pathname==="about#portfolio" ? "nav-link active" : "nav-link"} 
                style={{fontFamily:'Verdana'}}>
                Portfolio
                </Link> 

            </li>

            <li className="nav-item">
                <Link to="about#contact" className={location.pathname==="#contact" ? "nav-link active" : "nav-link"} 
                style={{fontFamily:'Verdana'}}>
                Contact
                </Link>    
            </li>

            <li className="nav-item">
                <Link to="/interact" className={location.pathname==="/interact" ? "nav-link active" : "nav-link"} 
                style={{fontFamily:'Verdana'}}>
                Interact
                </Link>    
            </li>
        </ul>
    </nav>

  );
}

export default NavBar;
